                        </Typography> 
                    </div>
                </Grid>

                <Grid style={styles.container}  container item sm={8} xs={12}>
                    <div>
                        <Typography variant="body2" align="center">
                            No profile found, please login
                        </Typography> 
                    </div>
                </Grid>
            </Grid>
        )

    }
}



export default (Modules);
